    <html>
    <head>
        <title>Interactive Market Dashboard</title>
        <script src="https://cdn.plot.ly/plotly-latest.min.js"></script>
        <link rel="stylesheet" href="../css/graph-style.css">
        <style>
            body {
                background-color: #111111;
                color: #E0E0E0;
                font-family: "Arial", sans-serif;
                margin: 0;
                padding: 20px;
            }
            h1 { text-align: center; margin-bottom: 5px; }
            
            .container {

                flex-direction: column;
                align-items: center;
                width: 100%;
                max-width: 1000px;
                margin: 0 auto;
            }
            
            .event-selector {
                background-color: #222;
                padding: 15px;
                border-radius: 5px;
                margin-bottom: 20px;
                border-left: 4px solid #00FFFF;
                width: 100%;
                text-align: center;
            }
            
            .event-selector label {
                font-weight: bold;
                margin-right: 10px;
                font-size: 16px;
            }
            
            .event-selector select {
                background-color: #333;
                color: #E0E0E0;
                border: 1px solid #555;
                padding: 8px 15px;
                border-radius: 4px;
                font-size: 14px;
                cursor: pointer;
                min-width: 250px;
            }
            
            .event-selector select:hover {
                border-color: #00FFFF;
            }
            
            #heatmap-container {
                width: 100%;
                height: 550px;
                margin-bottom: 20px;
                border: 1px solid #333;
                box-shadow: 0 0 20px rgba(0,0,0,0.5);
            }
            
            #chart-container {
                width: 100%;
                height: 500px;
                border: 1px solid #333;
                box-shadow: 0 0 20px rgba(0,0,0,0.5);
            }
            
            .instruction {
                background-color: #222;
                padding: 10px;
                border-radius: 5px;
                margin-bottom: 20px;
                border-left: 4px solid #00FFFF;
                text-align: center;
            }
        </style>
    </head>

            var eventNames = ["2008 Financial Crisis", "COVID-19 Market Crash", "over 25 years", "2016 U.S. Election"];

            // Current state
            var currentEvent = eventNames[0];
            var currentStockA = null;
            var currentStockB = null;
            
            // Populate dropdown
            var dropdown = document.getElementById('event-dropdown');
            eventNames.forEach(function(eventName) {
                var option = document.createElement('option');
                option.value = eventName;
                option.text = eventName;
                dropdown.appendChild(option);
            });
            
            // Function to get current event data
            function getCurrentData() {
                return allEventsData[currentEvent];
            }
            
            // Function to draw heatmap
            function drawHeatmap() {
                var data = getCurrentData();
                var stocks = data.stocks;
                
                var heatmapData = [{
                    z: data.corrZ,
                    x: stocks,
                    y: stocks,
                    type: 'heatmap',
                    colorscale: [
                        [0.0, '#B2182B'], 
                        [0.5, '#111111'], 
                        [1.0, '#2166AC']
                    ],
                    zmin: -1, zmax: 1,
                    xgap: 1, ygap: 1,
                    hovertemplate: '<b>%{y}</b> vs <b>%{x}</b><br>Corr: %{z:.2f}<extra></extra>',
                    colorbar: {
                        title: 'Correlation',
                        titlefont: {color: '#E0E0E0'},
                        tickfont: {color: '#E0E0E0'}
                    }
                }];

                var heatmapLayout = {
                    title: { text: 'Correlation Matrix - ' + currentEvent, font: {color: '#E0E0E0', size: 16} },
                    paper_bgcolor: '#111111',
                    plot_bgcolor: '#111111',
                    xaxis: { 
                        tickmode: 'array', 
                        tickvals: [...Array(stocks.length).keys()], 
                        ticktext: labels, 
                        tickangle: -45,
                        tickfont: { size: 10 }
                    },
                    yaxis: { 
                        tickmode: 'array', 
                        tickvals: [...Array(stocks.length).keys()], 
                        ticktext: labels, 
                        autorange: 'reversed',
                        tickfont: { size: 10 }
                    },
                    margin: {t: 50, b: 50, l: 80, r: 50}
                };

                Plotly.newPlot('heatmap-container', heatmapData, heatmapLayout);
                
                // Re-attach click handler
                var heatmapDiv = document.getElementById('heatmap-container');
                heatmapDiv.on('plotly_click', function(data){
                    if(data.points.length > 0){
                        var pt = data.points[0];
                        currentStockA = pt.y; 
                        currentStockB = pt.x; 
                        drawChart(currentStockA, currentStockB);
                    }
                });
            }
            
            // Function to draw line chart
            function drawChart(stockA, stockB) {
                var data = getCurrentData();
                var dates = data.dates;
                var stockData = data.stockData;
                
                var trace1 = {
                    x: dates,
                    y: stockData[stockA],
                    mode: 'lines',
                    name: stockA,
                    line: { color: colorMap[stockA] || '#888', width: 2 },
                    hovertemplate: '<b>' + stockA + '</b> (' + (sectorMap[stockA]||'') + ')<br>$%{y:.2f}<extra></extra>'
                };

                var trace2 = {
                    x: dates,
                    y: stockData[stockB],
                    mode: 'lines',
                    name: stockB,
                    line: { color: colorMap[stockB] || '#888', width: 2 },
                    hovertemplate: '<b>' + stockB + '</b> (' + (sectorMap[stockB]||'') + ')<br>$%{y:.2f}<extra></extra>'
                };

                var layout = {
                    title: { 
                        text: 'Performance: ' + stockA + ' vs ' + stockB, 
                        font: {color: '#E0E0E0', size: 16} 
                    },
                    paper_bgcolor: '#111111',
                    plot_bgcolor: '#111111',
                    xaxis: { 
                        showgrid: true, gridcolor: '#333', 
                        tickfont: {color: '#E0E0E0'},
                        type: 'date'
                    },
                    yaxis: { 
                        title: 'Growth of $1', 
                        titlefont: {color: '#E0E0E0'},
                        showgrid: true, gridcolor: '#333', 
                        tickfont: {color: '#E0E0E0'},
                        tickprefix: '$'
                    },
                    legend: { font: {color: '#E0E0E0'} },
                    hovermode: 'x unified'
                };

                Plotly.newPlot('chart-container', [trace1, trace2], layout);
            }
            
            // Event handler for dropdown change
            dropdown.addEventListener('change', function() {
                currentEvent = this.value;
                drawHeatmap();
                
                // Redraw chart with same stocks if they were selected
                var data = getCurrentData();
                var stocks = data.stocks;
                if (currentStockA && currentStockB && 
                    stocks.includes(currentStockA) && stocks.includes(currentStockB)) {
                    drawChart(currentStockA, currentStockB);
                } else {
                    // Default to first two stocks
                    currentStockA = stocks[0];
                    currentStockB = stocks[1];
                    drawChart(currentStockA, currentStockB);
                }
            });
            
            // Initialize with first event
            drawHeatmap();
            var firstData = getCurrentData();
            currentStockA = firstData.stocks[0];
            currentStockB = firstData.stocks[1];
            drawChart(currentStockA, currentStockB);
